import React from 'react'
import './App.css';
import { AppRouter } from './routing/AppRouter';
import { PruebaContext } from './context/PruebaContext';

function App() {
  return (
    <div className="App">


      <PruebaContext.Provider value="Isaias">
        <AppRouter />
      </PruebaContext.Provider>



    </div>
  );
}

export default App;
